import { StyleSheet } from 'react-native';

import { COLORS } from '../../../utils';

const styles = StyleSheet.create({
  container: {
    justifyContent: 'center',
    alignItems: 'center',
  },
  touch: {
    height: 200,
    width: 210,
  },
  logo: {
    height: '100%',
    width: '100%',
    // resizeMode: 'center',
  },
});

export default styles;
